说明:
你可以假设 k 总是有效的，且 1 ≤ k ≤ 数组的长度。
解法一（排序）
最朴素的方法是先对数组进行排序，再返回倒数第 k 个元素。

时间复杂度为: O(NlogN)
空间复杂度为: O(1)O(1)。
这个时间复杂度并不令人满意，让我们试着用额外空间来优化时间复杂度。

var findKthLargest = function(nums, k) {
    nums.sort((a, b)=>{return a-b})
    return nums[nums.length-k-1]
};


解法二（小顶堆）——第一版
我们尝试空间还换时间

尝试维护一个堆（数组即可）
堆的size = k，永远保持堆内的元素是较大的（即最终结果应该是数组第一大至第K大的元素集合）
维护堆内的元素，将较小的值，放置于堆顶
最后返回堆顶元素即可

我们根据上述思路写出第一版
var findKthLargest = function(nums, k) {
    var res = []
    nums.forEach(e => {
        if(res.length  res[0]){
            res[0] = e
        }
        res.sort((a, b)=>{
            return a-b
        }) // 维护排序
    });
    return res[0]
};


解法三（小顶堆）——第二版

思路是是正确的，但是我们是希望将时间负责度降低，那么就需要在维护堆上进行处理。

实现堆结构

function swap(arr, i ,j) {
    var temp = arr[i];
    arr[i] = arr[j];
    arr[j]= temp;
}

function heapify(arr, x, length) {
    var l = 2*x+1;
    var r = 2*x+2;
    var largest = x;
    if(l arr[largest]) {
        largest = l;
    }
    if(r arr[largest]) {
        largest = r;
    }
    if(largest!= x) {
        swap(arr, x, largest);
        // 递归交换以下的是否也建好堆.
        heapify(arr, largest, length);
    }
}

var findKthLargest = function(nums, k) {
    var size = nums.length;
    // 建立堆
    for(var i = parseInt(size/2)+1 ; i >=0 ;i --) {
        heapify(nums, i, size);
    }
    // 排序
    for(var j= size-1; j>=size-k; j--) {
        // 得到本次的最大，将最大的与最后一个交换位子
        swap(nums, 0, j);
        heapify(nums, 0, j);
    }
    return nums[size-k];
}

